public void success(String operation) {
  String op = operation.toLowerCase(Locale.ROOT);
  Stat stat = stats.get(op);
  if (stat == null) {
    stat = new Stat();
    stats.put(op, stat);
  }
  stat.success.incrementAndGet();
}

public void success(String operation) {
  String op = operation.toLowerCase(Locale.ROOT);
  synchronized (stats) {
    Stat stat = stats.get(op);
    if (stat == null) {
      stat = new Stat();
      stats.put(op, stat);
    }
    stat.success.incrementAndGet();
  }
}

